import React, { useState, useEffect } from "react";
import axios from "axios";

const VendorProfileSetup = ({ userId }) => {
  const [businessName, setBusinessName] = useState("");
  const [vendorType, setVendorType] = useState("");
  const [contactNumber, setContactNumber] = useState("");
  const [email, setEmail] = useState("");
  const [location, setLocation] = useState("");
  const [pricing, setPricing] = useState("");
  const [profileImage, setProfileImage] = useState(null);
  const [previewImage, setPreviewImage] = useState("");

  // Fetch vendor details
  useEffect(() => {
    axios.get(`http://localhost:3000/api/vendor/profile/${userId}`)
      .then(response => {
        const data = response.data.data;
        setBusinessName(data.businessName);
        setVendorType(data.vendorType);
        setContactNumber(data.contactNumber);
        setEmail(data.email);
        setLocation(data.location);
        setPricing(data.pricing);
        setPreviewImage(data.profile_image || ""); // Display profile image if available
      })
      .catch(error => console.error("Error fetching vendor profile:", error));
  }, [userId]);

  const handleImageChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setProfileImage(file);
      setPreviewImage(URL.createObjectURL(file));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();
    formData.append("user_id", userId);
    formData.append("businessName", businessName);
    formData.append("vendorType", vendorType);
    formData.append("contactNumber", contactNumber);
    formData.append("email", email);
    formData.append("location", location);
    formData.append("pricing", pricing);
    if (profileImage) {
      formData.append("profileImage", profileImage);
    }

    try {
      const response = await axios.put("http://localhost:3000/api/vendor/profile", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      alert(response.data.message);
    } catch (error) {
      console.error("Error updating profile:", error);
      alert("Failed to update profile.");
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-white">
      <div className="bg-white shadow-lg rounded-2xl p-8 w-full max-w-3xl">
        <h2 className="text-3xl font-bold text-center text-black bg-[#B87C66] py-3 rounded-lg">
          Set Your Profile
        </h2>

        <form onSubmit={handleSubmit} className="mt-6 space-y-4">
          <div className="text-center">
            <label className="block text-lg text-black">Profile Picture</label>
            <div className="relative w-32 h-32 mx-auto">
              {previewImage ? (
                <img
                  src={previewImage}
                  alt="Profile Preview"
                  className="w-32 h-32 rounded-full object-cover border border-gray-300"
                />
              ) : (
                <div className="w-32 h-32 rounded-full bg-gray-200 flex items-center justify-center text-gray-500">
                  No Image
                </div>
              )}
            </div>
            <input
              type="file"
              accept="image/*"
              onChange={handleImageChange}
              className="hidden"
              id="profile-upload"
            />
            <label
              htmlFor="profile-upload"
              className="mt-3 inline-block bg-[#B87C66] text-white py-2 px-4 rounded-lg text-lg hover:bg-[#9c6753] transition cursor-pointer"
            >
              Upload Picture
            </label>
          </div>

          <div>
            <label className="block text-lg text-black">Name of your Business</label>
            <input
              type="text"
              value={businessName}
              onChange={(e) => setBusinessName(e.target.value)}
              className="w-full px-4 py-2 border bg-gray-100 rounded-lg text-black"
              required
            />
          </div>

          <div>
            <label className="block text-lg text-black">Type</label>
            <input
              type="text"
              value={vendorType}
              onChange={(e) => setVendorType(e.target.value)}
              className="w-full px-4 py-2 border bg-gray-100 rounded-lg text-black"
              required
            />
          </div>

          <div>
            <label className="block text-lg text-black">Contact Number</label>
            <input
              type="tel"
              value={contactNumber}
              onChange={(e) => setContactNumber(e.target.value)}
              className="w-full px-4 py-2 border bg-gray-100 rounded-lg text-black"
              required
            />
          </div>

          <div>
            <label className="block text-lg text-black">Email Address</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="w-full px-4 py-2 border bg-gray-100 rounded-lg text-black"
              required
            />
          </div>

          <div>
            <label className="block text-lg text-black">Location</label>
            <input
              type="text"
              value={location}
              onChange={(e) => setLocation(e.target.value)}
              className="w-full px-4 py-2 border bg-gray-100 rounded-lg text-black"
              required
            />
          </div>

          <div>
            <label className="block text-lg text-black">Pricing</label>
            <input
              type="text"
              value={pricing}
              onChange={(e) => setPricing(e.target.value)}
              className="w-full px-4 py-2 border bg-gray-100 rounded-lg text-black"
              required
            />
          </div>

          <button
            type="submit"
            className="w-full mt-4 bg-[#B87C66] text-white py-3 rounded-lg text-lg hover:bg-[#9c6753] transition"
          >
            Save Profile
          </button>
        </form>
      </div>
    </div>
  );
};

export default VendorProfileSetup;
